      <Grid item>
      <Button sm={4} xs={12} variant="contained" color='primary' sx={{width:"100%"}}>BUTTON-1</Button>
      </Grid>
      <Grid item>
      <Button sm={4} xs={12} variant="contained" color="secondary" sx={{width:"100%"}}>BUTTON-2</Button>
      </Grid>
      <Grid item>
      <Button sm={4} xs={12} variant="contained" color="warning" sx={{width:"100%"}}>BUTTON-3</Button>
      </Grid>
    </Grid>
    </>
  );
  return design;
}
export default TestGri;
